import React, { Fragment,Component } from "react";
import { MDBCard, MDBCardBody, MDBCardHeader, MDBInput } from "mdbreact";

class TagList extends Component {

render() {
  return (
    <MDBCard className="card mb-4 text-center wow fadeIn">

                <MDBCardHeader className="card-header">Do you want to get informed about new articles?</MDBCardHeader>


                <MDBCardBody className="card-body">


                    <form>


                        <label for="defaultFormEmailEx" className="grey-text">Your email</label>
                        <MDBInput type="email" id="defaultFormLoginEmailEx" className="form-control"/>




                        <label for="defaultFormNameEx" className="grey-text">Your name</label>
                        <MDBInput type="text" id="defaultFormNameEx" className="form-control"/>

                        <Fragment>
                            <button className="btn btn-info btn-md" type="submit">Sign up</button>
                        </Fragment>
                    </form>


                </MDBCardBody>

                </MDBCard>
    );
  }
}

export default TagList;
